import React, { useState, useEffect, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { UserContext } from '../contexts/UserContext';
import { FaPencilAlt, FaMapMarkedAlt, FaTrash, FaEye } from 'react-icons/fa';
import axios from 'axios';
import '../styles/Profile.css';

const Profile = () => {
  const { user } = useContext(UserContext);
  const [savedRoadmaps, setSavedRoadmaps] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSavedRoadmaps = async () => {
      try {
        const storedUser = JSON.parse(localStorage.getItem('user'));
        if (!storedUser?._id) {
          setIsLoading(false);
          return;
        }

        console.log('Fetching roadmaps for user:', storedUser._id); // Debug log

        const response = await axios.get(
          `http://localhost:5000/api/roadmaps/user/${storedUser._id}`,
          {
            headers: {
              'Authorization': `Bearer ${localStorage.getItem('token')}`
            }
          }
        );

        console.log('Fetched roadmaps:', response.data); // Debug log

        if (Array.isArray(response.data)) {
          setSavedRoadmaps(response.data);
        } else {
          console.error('Invalid response format:', response.data);
          setSavedRoadmaps([]);
        }
      } catch (error) {
        console.error('Error fetching roadmaps:', error);
        if (error.response) {
          console.log('Error response:', error.response.data);
        }
      } finally {
        setIsLoading(false);
      }
    };

    fetchSavedRoadmaps();
  }, []);

  const handleDeleteRoadmap = async (roadmapId) => {
    try {
      await axios.delete(`/api/roadmaps/${roadmapId}`);
      setSavedRoadmaps(prevRoadmaps => 
        prevRoadmaps.filter(roadmap => roadmap._id !== roadmapId)
      );
    } catch (error) {
      console.error('Error deleting roadmap:', error);
      alert('Failed to delete roadmap');
    }
  };

  const handleViewRoadmap = (roadmap) => {
    // Store the roadmap details in localStorage for viewing
    localStorage.setItem('viewRoadmap', JSON.stringify(roadmap));
    navigate('/roadmap-details');
  };

  if (!user) {
    return (
      <div className="profile-container">
        <div className="no-user">
          <span className="material-icons">account_circle</span>
          <h2>Please Log In</h2>
          <p>You need to be logged in to view your profile</p>
          <Link to="/login" className="login-button">
            Go to Login
          </Link>
        </div>
      </div>
    );
  }

  return (
    <div className="profile-container">
      <div className="profile-header-section">
        <div className="profile-cover">
          <div className="profile-avatar-wrapper">
            <div className="profile-avatar">
              {user?.name ? user.name[0].toUpperCase() : '?'}
            </div>
            <button 
              className="edit-button"
              onClick={() => navigate('/profile/edit')}
              title="Edit Profile"
            >
              <FaPencilAlt />
            </button>
          </div>
        </div>
        
        <div className="profile-info-card">
          <h1 className="profile-name">{user?.name}</h1>
          <p className="profile-email">{user?.email}</p>
          <div className="profile-stats">
            <div className="stat-item">
              <span className="stat-number">{savedRoadmaps.length}</span>
              <span className="stat-label">Roadmaps</span>
            </div>
            <div className="stat-item">
              <span className="stat-number">0</span>
              <span className="stat-label">Completed</span>
            </div>
            <div className="stat-item">
              <span className="stat-number">0</span>
              <span className="stat-label">In Progress</span>
            </div>
          </div>
        </div>
      </div>

      <div className="content-section">
        <div className="section-header">
          <h2>My Career Roadmaps</h2>
          <Link to="/" className="new-roadmap-button">
            Create New
          </Link>
        </div>

        {isLoading ? (
          <div className="loading-container">
            <div className="loader"></div>
            <p>Loading your roadmaps...</p>
          </div>
        ) : savedRoadmaps.length > 0 ? (
          <div className="roadmaps-grid">
            {savedRoadmaps.map((roadmap) => (
              <div key={roadmap._id} className="roadmap-card">
                <div className="roadmap-card-header">
                  <FaMapMarkedAlt className="roadmap-icon" />
                  <h3>{roadmap.roadmap.title}</h3>
                </div>
                
                <div className="roadmap-card-content">
                  <div className="roadmap-detail">
                    <strong>Career Path:</strong>
                    <span>{roadmap.careerPath}</span>
                  </div>
                  <div className="roadmap-detail">
                    <strong>Technology:</strong>
                    <span>{roadmap.technology}</span>
                  </div>
                  
                  <div className="skills-section">
                    <strong>Key Skills:</strong>
                    <div className="skills-tags">
                      {roadmap.roadmap.skills.slice(0, 3).map((skill, index) => (
                        <span key={index} className="skill-tag">{skill}</span>
                      ))}
                      {roadmap.roadmap.skills.length > 3 && (
                        <span className="skill-tag more">+{roadmap.roadmap.skills.length - 3}</span>
                      )}
                    </div>
                  </div>
                </div>

                <div className="roadmap-card-actions">
                  <button 
                    className="action-button view"
                    onClick={() => handleViewRoadmap(roadmap)}
                  >
                    <FaEye /> View
                  </button>
                  <button 
                    className="action-button delete"
                    onClick={() => handleDeleteRoadmap(roadmap._id)}
                  >
                    <FaTrash />
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <FaMapMarkedAlt className="empty-icon" />
            <h3>No Roadmaps Yet</h3>
            <p>Create your first career roadmap to get started</p>
            <Link to="/" className="create-first-button">
              Create Your First Roadmap
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
